  <style>
    /* Кастомные стили для сплеша с темой "West" */
    #splash {
      position: fixed;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      /* <<< ИЗМЕНЕНО: Коричневый градиент фона из "west" */
      background: linear-gradient(135deg, #4d2c1a, #2c1a0e);
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      z-index: 9999;
      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Arial, sans-serif;
      transition: opacity 0.8s ease-out;
    }
    /* Контейнер для логотипа */
    .logo-container {
      margin-bottom: 60px;
      display: flex;
      justify-content: center;
      align-items: center;
      position: relative;
    }
    .game-logo {
      max-width: 60vw;
      max-height: 40vh;
      width: auto;
      height: auto;
      animation: logoFloat 3s ease-in-out infinite;
      filter: drop-shadow(0 8px 16px rgba(0, 0, 0, 0.3));
      border-radius: 12px;
    }
    /* Улучшенные анимации */
    @keyframes logoFloat {
      0%, 100% { 
        transform: translateY(0px) scale(1);
        filter: drop-shadow(0 8px 16px rgba(0, 0, 0, 0.3));
      }
      50% { 
        transform: translateY(-10px) scale(1.02);
        filter: drop-shadow(0 12px 24px rgba(0, 0, 0, 0.4));
      }
    }
    .loading-text {
      color: white; /* Текст оставлен белым, как в "west" */
      font-size: 18px;
      font-weight: 600;
      text-align: center;
      text-shadow: 0 2px 8px rgba(0, 0, 0, 0.5);
      margin-bottom: 30px;
      letter-spacing: 0.5px;
      opacity: 0;
      animation: fadeInUp 0.8s ease-out 0.5s forwards;
    }
    /* Улучшенный прогресс-бар */
    .progress-container {
      width: 320px;
      max-width: 80vw;
      position: relative;
    }
    .progress-bar {
      width: 100%;
      height: 12px;
      /* <<< ИЗМЕНЕНО: Фон прогресс-бара из "west" */
      background: rgba(0, 0, 0, 0.4);
      border-radius: 8px;
      overflow: hidden;
      position: relative;
      /* <<< ИЗМЕНЕНО: Рамка, как в "west" */
      border: 1px solid rgba(255, 255, 255, 0.5);
      box-shadow: inset 0 2px 4px rgba(0, 0, 0, 0.2);
    }
    .progress-fill {
      height: 100%;
      /* <<< ИЗМЕНЕНО: Золотистый градиент загрузки из "west" */
      background: linear-gradient(90deg, #ffc107, #ff8a07);
      border-radius: 8px;
      width: 0%;
      transition: width 0.4s cubic-bezier(0.4, 0, 0.2, 1);
      position: relative;
      overflow: hidden;
    }
    .progress-fill::before {
      content: '';
      position: absolute;
      top: 0;
      left: -100%;
      width: 100%;
      height: 100%;
      background: linear-gradient(90deg, 
        transparent 0%, 
        rgba(255, 255, 255, 0.4) 50%, 
        transparent 100%
      );
      animation: progressShine 2s ease-in-out infinite;
    }
    @keyframes progressShine {
      0% { left: -100%; }
      100% { left: 100%; }
    }
    .loading-percentage {
      color: rgba(255, 255, 255, 0.9); /* Текст оставлен белым */
      font-size: 14px;
      font-weight: 500;
      text-shadow: 0 1px 3px rgba(0, 0, 0, 0.4);
      margin-top: 15px;
      text-align: center;
      font-family: 'Courier New', monospace;
      letter-spacing: 1px;
    }
    .loading-dots {
      color: rgba(255, 255, 255, 0.8);
      font-size: 16px;
      margin-left: 8px;
      animation: loadingDots 1.5s ease-in-out infinite;
    }
    @keyframes loadingDots {
      0%, 20% { opacity: 0; }
      50% { opacity: 1; }
      100% { opacity: 0; }
    }
    /* Адаптивность для мобильных устройств (сохранена) */
    @media (max-width: 480px) {
      .game-logo {
        max-width: 70vw;
        max-height: 35vh;
      }
      .progress-container { width: 280px; }
      .loading-text { font-size: 16px; margin-bottom: 25px; }
      .loading-percentage { font-size: 13px; margin-top: 12px; }
      .logo-container { margin-bottom: 40px; }
    }
    /* Адаптация для альбомной ориентации (сохранена) */
    @media (orientation: landscape) and (max-height: 600px) {
      .game-logo { max-width: 50vw; max-height: 50vh; }
      .logo-container { margin-bottom: 25px; }
      .loading-text { font-size: 16px; margin-bottom: 20px; }
      .progress-container { width: 300px; }
    }
    /* Для широких экранов в альбомной ориентации (сохранена) */
    @media (orientation: landscape) and (min-width: 768px) {
      .game-logo { max-width: 45vw; max-height: 60vh; }
      .progress-container { width: 350px; }
    }
    /* Анимации появления (сохранены) */
    @keyframes fadeInUp {
      from { opacity: 0; transform: translateY(30px); }
      to { opacity: 1; transform: translateY(0); }
    }
    @keyframes fadeInScale {
      from { opacity: 0; transform: scale(0.8) translateY(20px); }
      to { opacity: 1; transform: scale(1) translateY(0); }
    }
    .logo-container { animation: fadeInScale 1s ease-out; }
    .progress-container { animation: fadeInUp 0.8s ease-out 0.8s both; }
    /* Скрытие загрузчика */
    #splash.hide { opacity: 0; pointer-events: none; }
    /* Дополнительные эффекты (частицы сохранены, но фон за ними будет коричневый) */
    .bg-particles {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      overflow: hidden;
      z-index: -1;
    }
    .particle {
      position: absolute;
      width: 4px;
      height: 4px;
      background: rgba(255, 255, 255, 0.1); /* Частицы оставлены светлыми */
      border-radius: 50%;
      animation: float 6s ease-in-out infinite;
    }
    .particle:nth-child(1) { left: 10%; animation-delay: 0s; }
    .particle:nth-child(2) { left: 20%; animation-delay: 1s; }
    .particle:nth-child(3) { left: 30%; animation-delay: 2s; }
    .particle:nth-child(4) { left: 40%; animation-delay: 3s; }
    .particle:nth-child(5) { left: 50%; animation-delay: 4s; }
    .particle:nth-child(6) { left: 60%; animation-delay: 5s; }
    .particle:nth-child(7) { left: 70%; animation-delay: 0.5s; }
    .particle:nth-child(8) { left: 80%; animation-delay: 1.5s; }
    .particle:nth-child(9) { left: 90%; animation-delay: 2.5s; }
    @keyframes float {
      0%, 100% { transform: translateY(100vh) scale(0); }
      10% { transform: translateY(90vh) scale(1); }
      90% { transform: translateY(-10vh) scale(1); }
      100% { transform: translateY(-10vh) scale(0); }
    }
  </style>
